import React from 'react';
import DatePicker from "react-datepicker";

const Card=()=>(
    <div>
        <div className="inputs">
            <label>
                Credit/Debit/ATM card
            </label>
            <input type="text" placeholder="Enter Card Number"/>
            <DatePicker/>

        </div>
    </div>
)

export default Card;
